import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Header from "./header"

// Sayfaları kendi dosya adlarına göre import ediyoruz
import MainPage from "./mainpage";
import ComparePage from "./comparepage";
import LoginPage from "./loginpage";
import SignupPage from "./signuppage";
import ProfilPage from "./profilpage";
import AddCar from "./addcar";
import CarPage from "./carpage"; // eğer tekil araba detay sayfası olacaksa
import CarListPage from "./carlistpage";

const AppWrapper = () => {
  const location = useLocation();
  const hideHeaderRoutes = ["/login", "/signup", "/"];
  const showHeader = !hideHeaderRoutes.includes(location.pathname);
}

const App = () => {

  return (
    <>
    {showHeader && <Header />}
    <Router>
      <Routes>
        <Route path="/" element={<MainPage />} />
        <Route path="/favourite" element={<favouritePage />} />
        <Route path="/compare" element={<ComparePage />} />
        <Route path="/login" element={<LoginPage />} />
        <Route path="/signup" element={<SignupPage />} />
        <Route path="/profilepage" element={<ProfilPage />} />
        <Route path="/add-car" element={<AddCar />} />
        <Route path="/car" element={<CarPage />} /> {/* opsiyonel */}
        <Route path="/carlistpage" element={<CarListPage />} /> {/* opsiyonel */}
      </Routes>
    </Router>
    </>
  );
};

export default App;
